import { Breadcrumb, Space } from "antd";
import Link from "next/link";
const MenuNavibarLayout = ({ menus }) => {
  return (
    <div style={{ backgroundColor: "white" }}>
      <Breadcrumb separator={""}>
        <Space size={`middle`}>
          {menus.map((menu) => (
            <Breadcrumb.Item>
              <h3>{menu}</h3>
            </Breadcrumb.Item>
          ))}
        </Space>
      </Breadcrumb>
    </div>
  );
};

export default MenuNavibarLayout;
